import React, {useState,useEffect} from 'react'
import SearchBar from "./Components/SearchBar";
import "./App.css";

function App() {
  const [data,setData] = useState([{}])
  const [search, setSearch] = useState("");
  useEffect(() => {
    fetch("/titles").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
      }
    )
  },[])
  return (
    <div className="App">
      <SearchBar placeholder="Enter a Movie You Like" data={data} setSearch = {setSearch} />
    </div>
  );
} 

export default App;
